import styled from 'styled-components'

let Flex = styled.div`

    display: flex;


`
let Title = styled.h1`

    font-size: 3rem;
    color: #fff;

`

export default function Register() {
  return (
    <Flex>
        <Title>Register</Title>


    </Flex>
  )
}
